import React from "react";
import home from "./HomePage.module.css"

const HomePage = () => {
    const listTo = [
            {id: "viktor", name: "Viktor"},
            {id: "stepan", name: "Stepan"},
            {id: "oleg", name: "Oleg"},
            {id: "greta", name: "Greta"},
        ]
    const linkDataNew = listTo.map(user => <a href={"/"} className={home.item}>{user.name}</a>)
    return (
        <div>
            <ul className={home.list}>
                {linkDataNew}
            </ul>
        </div>
    )
}

export default HomePage
